import React from 'react';
import { Avatar, Box } from '@mui/material';

const RUNE_STYLE_NAMES = {
  8100: 'Domination',
  8300: 'Inspiration',
  8000: 'Precision',
  8400: 'Resolve',
  8200: 'Sorcery',
};

const RUNE_PERK_NAMES = {
  8112: 'Electrocute',
  8124: 'Predator',
  8128: 'DarkHarvest',
  9923: 'HailOfBlades',
  8351: 'GlacialAugment',
  8360: 'UnsealedSpellbook',
  8005: 'PressTheAttack',
  8008: 'LethalTempo',
  8021: 'FleetFootwork',
  8010: 'Conqueror',
  8437: 'GraspOfTheUndying',
  8439: 'Aftershock',
  8465: 'Guardian',
  8214: 'SummonAery',
  8229: 'ArcaneComet',
  8230: 'PhaseRush',
};

function RuneImages({ runes }) {
  return (
    <Box display="flex" gap={0.5}>
      {runes.map((runeStyle, index) => {
        const styleName = RUNE_STYLE_NAMES[runeStyle.style] || 'Unknown';
        const perkName = RUNE_PERK_NAMES[runeStyle.selections[0]?.perk] || 'Unknown';

        return (
          <Avatar
            key={`rune-${index}`}
            src={`https://ddragon.leagueoflegends.com/cdn/img/perk-images/Styles/${styleName}/${perkName}/${perkName}.png`}
            alt={`Rune ${styleName}`}
            sx={{ width: 24, height: 24, mr: 0.5, borderRadius: '4px', bgcolor: '#2d3748' }}
            variant="rounded"
          />
        );
      })}
    </Box>
  );
}

export default RuneImages;
